(104, 'Cereal [1] - ', 'thumbnail/f5cbe53ea472ff15ff35dd4e1508338d64e6d90f.jpeg', 1, '2014-09-05 19:33:38', '2014-09-05 19:33:38', 'f5cbe53ea472ff15ff35dd4e1508338d64e6d90f.jpeg', 'A food made from processed grains that is often eaten cold, usually mixed with milk (e.g. cow''s milk, soy milk, rice milk, almond milk), juice, water, or yogurt, and sometimes fruit, but may be eaten dry.'),
(105, 'Bitterballen', 'thumbnail/03738a0ee523aed6e33efeebc2658b03393af418.jpeg', 1, '2014-09-05 19:35:06', '2014-09-05 19:35:06', '03738a0ee523aed6e33efeebc2658b03393af418.jpeg', 'County: Netherlands\n\r\n\rA round shaped beef-ragout version of croquette, typically containing a mixture of beef or veal (minced or chopped), beef broth, butter, flour for thickening, parsley, salt and pepper, resulting in a thick ragout. Most recipes include nutmeg and there are also variations utilizing curry powder or that add in finely chopped vegetables such as carrot.'),
(106, 'Bonda', 'thumbnail/b920128a1dd89e6fa1aca6065815502e43835295.jpeg', 1, '2014-09-05 19:35:07', '2014-09-05 19:35:07', 'b920128a1dd89e6fa1aca6065815502e43835295.jpeg', 'County: South India\n\r\n\rVarious sweet and spicy versions of exist different regions. The process of making a spicy bonda involves deep-frying potato (or other vegetables) filling dipped in gram flour batter.'),
