(117, 'Bitterballen', 'thumbnail/ceb9c7e710732246f12ae14ee92b95f930fdfc10.jpeg', 1, '2014-09-05 19:40:35', '2014-09-05 19:40:35', 'ceb9c7e710732246f12ae14ee92b95f930fdfc10.jpeg', 'County: Netherlands\n\r\n\rA round shaped beef-ragout version of croquette, typically containing a mixture of beef or veal (minced or chopped), beef broth, butter, flour for thickening, parsley, salt and pepper, resulting in a thick ragout. Most recipes include nutmeg and there are also variations utilizing curry powder or that add in finely chopped vegetables such as carrot.'),
(118, 'Bonda', 'thumbnail/2de5073d3dc6077ad7f01c50ef6e6f9eac077f86.jpeg', 1, '2014-09-05 19:40:35', '2014-09-05 19:40:35', '2de5073d3dc6077ad7f01c50ef6e6f9eac077f86.jpeg', 'County: South India\n\r\n\rVarious sweet and spicy versions of exist different regions. The process of making a spicy bonda involves deep-frying potato (or other vegetables) filling dipped in gram flour batter.'),
(119, 'Cereal [1]', 'thumbnail/ee8c9f5afe976df695531a670d1956f76f26de41.jpeg', 1, '2014-09-05 19:40:36', '2014-09-05 19:40:36', 'ee8c9f5afe976df695531a670d1956f76f26de41.jpeg', 'County: \n\r\n\rA food made from processed grains that is often eaten cold, usually mixed with milk (e.g. cow''s milk, soy milk, rice milk, almond milk), juice, water, or yogurt, and sometimes fruit, but may be eaten dry.'),
(120, 'Crêpe', 'thumbnail/aae8d84670999388588cde3289dc430e1e8b4a37.jpeg', 1, '2014-09-05 19:40:36', '2014-09-05 19:40:36', 'aae8d84670999388588cde3289dc430e1e8b4a37.jpeg', 'County: Brittany, France\n\r\n\rA type of very thin pancake, usually made from wheat flour (crêpes de Froment) or buckwheat flour (galettes). The word is of French origin, deriving from the Latin crispa, meaning "curled".'),
(121, 'Croquette', 'thumbnail/5fe66689338b9b3cd12230f3bd0ce0b04a1711c3.jpeg', 1, '2014-09-05 19:40:36', '2014-09-05 19:40:36', '5fe66689338b9b3cd12230f3bd0ce0b04a1711c3.jpeg', 'County: France\n\r\n\rA French invention with worldwide popularity, a croquette is a small breadcrumbed fried food roll containing, usually as main ingredients, mashed potatoes and/or ground meat (veal, beef, chicken, or turkey), shellfish, fish, cheese, vegetables and mixed with béchamel or brown sauce,[2] and soaked white bread, egg, onion, spices and herbs, wine, milk, beer or any of the combination thereof, sometimes with a filling, e.g. sauteed onions or mushrooms, boiled eggs (Scotch eggs).[3]'),
(122, 'Doughnut [4]', 'thumbnail/931598503bb54145a0b4ecf97bfa49509eab3f50.jpeg', 1, '2014-09-05 19:40:38', '2014-09-05 19:40:38', '931598503bb54145a0b4ecf97bfa49509eab3f50.jpeg', 'County: \n\r\n\rA fried dough snack popular in most parts of the world'),
(123, 'Gulha', 'thumbnail/ccfb27f908cea616d9a8c324830bbf4acd2556b6.jpeg', 1, '2014-09-05 19:40:38', '2014-09-05 19:40:38', 'ccfb27f908cea616d9a8c324830bbf4acd2556b6.jpeg', 'County: \n\r\n\rA popular snack in Maldives[5]'),
(124, 'Khanom buang', 'thumbnail/3e51b2cfc54bf660dccfe730277d02fd845b9a0c.jpeg', 1, '2014-09-05 19:40:38', '2014-09-05 19:40:38', '3e51b2cfc54bf660dccfe730277d02fd845b9a0c.jpeg', 'County: Thailand\n\r\n\rA snack sold by street vendors in Thailand'),
(125, 'Pakora', 'thumbnail/be45dadca2cba94a3dc7700a5a3759a3ea03d837.jpeg', 1, '2014-09-05 19:40:39', '2014-09-05 19:40:39', 'be45dadca2cba94a3dc7700a5a3759a3ea03d837.jpeg', 'County: India\n\r\n\rA fried snack (fritter) found across South Asia'),
(126, 'Pancakes', 'thumbnail/4967aefc16f929de3c78a6b3695b02770f65dd8d.jpeg', 1, '2014-09-05 19:40:40', '2014-09-05 19:40:40', '4967aefc16f929de3c78a6b3695b02770f65dd8d.jpeg', 'County: \n\r\n\rPowder mix made in the morning for breakfast with syrup'),
(127, 'Pizza [6]', 'thumbnail/8318f433a08f629ccf7bba3801aed77e9dda6ee6.jpeg', 1, '2014-09-05 19:40:40', '2014-09-05 19:40:40', '8318f433a08f629ccf7bba3801aed77e9dda6ee6.jpeg', 'County: Disputed. Sources state that Ancient Greece and Italy are likely.[7][8][9]\n\r\n\rSuch as mini pizza and pizza baguette,[10] as well as pizza sold by the slice or by weight'),
(128, 'Pretzel Soft', 'thumbnail/f672b3d1a28883183628b9d830eba202713b478d.jpeg', 1, '2014-09-05 19:40:41', '2014-09-05 19:40:41', 'f672b3d1a28883183628b9d830eba202713b478d.jpeg', 'County: German Italian-American\n\r\n\rA traditional baked treat'),
(129, 'Poffertjes', 'thumbnail/5c25b088db5f3826efe39123a6136c4b81e65775.jpeg', 1, '2014-09-05 19:40:41', '2014-09-05 19:40:41', '5c25b088db5f3826efe39123a6136c4b81e65775.jpeg', 'County: Netherlands\n\r\n\rA traditional Dutch batter treat'),
(130, 'Waffle', 'thumbnail/d77e3868b2a8f61d7bd5f13287e11e713ae988d0.jpeg', 1, '2014-09-05 19:40:42', '2014-09-05 19:40:42', 'd77e3868b2a8f61d7bd5f13287e11e713ae988d0.jpeg', 'County: Belgium\n\r\n\ra batter-based or dough-based cake cooked in a waffle iron patterned to give a characteristic size, shape and surface impression. There are many variations based on the type of iron and recipe used, with over a dozen regional varieties in Belgium alone.[11]'),
(131, 'Brittle', 'thumbnail/e6143ce9c446d3708e09b6bb12d474701ac5ce68.jpeg', 1, '2014-09-05 19:40:42', '2014-09-05 19:40:42', 'e6143ce9c446d3708e09b6bb12d474701ac5ce68.jpeg', 'County: \n\r\n\rA type of confection consisting of flat broken pieces of hard sugar candy embedded with nuts such as pecans, almonds, or peanuts. Pictured is peanut brittle cracked on a serving dish'),
(132, 'Bubblegum', 'thumbnail/1222fbe4002bd8b561d44cc623c38fc3cde9d225.jpeg', 1, '2014-09-05 19:40:42', '2014-09-05 19:40:42', '1222fbe4002bd8b561d44cc623c38fc3cde9d225.jpeg', 'County: \n\r\n\rA type of chewing gum, designed to be inflated out of the mouth as a bubble. As with chewing gum, the product is made from chicle and is available in various flavors.'),
(133, 'Candy', 'thumbnail/a542c53ca960a2449a2f3e08cd71278ef1858f5e.jpeg', 1, '2014-09-05 19:40:43', '2014-09-05 19:40:43', 'a542c53ca960a2449a2f3e08cd71278ef1858f5e.jpeg', 'County: \n\r\n\rAlso known as "lollies", many diverse candies exist, which include (but is not limited to) candy cane, candy corn, gumdrop, gummi bear, gummi candy, jawbreaker, jelly baby, jelly bean, licorice (also spelled liquorice), lollipop, rock candy and taffy.'),
(134, 'Chocolate [6]', 'thumbnail/2d571fce998e3fb49700f9617ed47689080967ec.jpeg', 1, '2014-09-05 19:40:43', '2014-09-05 19:40:43', '2d571fce998e3fb49700f9617ed47689080967ec.jpeg', 'County: \n\r\n\rChocolate has been used as a drink for nearly all of its history, and has become one of the most popular food types and flavors in the world. Sweet chocolate such as milk chocolate and dark chocolate are typically eaten as a snack food, as opposed to unsweetened chocolate, which contains primarily cocoa solids and cocoa butter in varying proportions.'),
(135, 'Chocolate bar [12]', 'thumbnail/a9dbd0896d03c13c39b71ef911f7bcd5a8407f17.jpeg', 1, '2014-09-05 19:40:43', '2014-09-05 19:40:43', 'a9dbd0896d03c13c39b71ef911f7bcd5a8407f17.jpeg', 'County: \n\r\n\rA confection in bar form comprising some or all of the following components: cocoa solids, cocoa butter, sugar, milk. The relative presence or absence of these components form the subclasses of dark chocolate, milk chocolate, and white chocolate.'),
(136, 'Chocolate Rugelach', 'thumbnail/16e370f325e67353d4eba6a1274b57ff1617c3d2.jpeg', 1, '2014-09-05 19:40:44', '2014-09-05 19:40:44', '16e370f325e67353d4eba6a1274b57ff1617c3d2.jpeg', 'County: \n\r\n\rPrepared with a cream cheese dough and a filling consisting of chocolate, jam (or jelly) and cinnamon.[13] The addition of raisins and nuts and raisins is also common.[13]'),
(137, 'Chocolate truffle', 'thumbnail/06d935599f7ca09f96c1180f546da9634021c8f1.jpeg', 1, '2014-09-05 19:40:44', '2014-09-05 19:40:44', '06d935599f7ca09f96c1180f546da9634021c8f1.jpeg', 'County: \n\r\n\rA type of chocolate confectionery, traditionally made with a chocolate ganache centre coated in chocolate, icing sugar, cocoa powder or chopped toasted nuts (typically hazelnuts, almonds or coconut), usually in a spherical, conical, or curved shape. Other fillings may replace the ganache.'),
(138, 'Fudge', 'thumbnail/a95a69dea33ba4fd479831875c24310acf12272f.jpeg', 1, '2014-09-05 19:40:45', '2014-09-05 19:40:45', 'a95a69dea33ba4fd479831875c24310acf12272f.jpeg', 'County: \n\r\n\rTypically sweet and rich, it''s prepared by mixing sugar, butter, and milk, heating it to the soft-ball stage at 240 °F (116 °C) and then beating the mixture while it cools so that it acquires a smooth, creamy consistency. Many variations exist with other flavorings added, such as chocolate.'),
(139, 'Geplak', 'thumbnail/4eb83dcad439f1cc3a164dcfdaeb01b76791baa1.jpeg', 1, '2014-09-05 19:40:45', '2014-09-05 19:40:45', '4eb83dcad439f1cc3a164dcfdaeb01b76791baa1.jpeg', 'County: \n\r\n\rMade from equal parts coarsely grated coconut and sugar, in equal amounts, often colored brightly. Other variations exist.'),
(140, 'Grass jelly', 'thumbnail/f61e2f4d3f1199f88ad2ca803a4d93262b4da28a.jpeg', 1, '2014-09-05 19:40:46', '2014-09-05 19:40:46', 'f61e2f4d3f1199f88ad2ca803a4d93262b4da28a.jpeg', 'County: \n\r\n\rA jelly-like dessert prepared by boiling the aged and slightly oxidized stalks and leaves of Mesona chinensis[14][15] (member of the mint family) with potassium carbonate for several hours with a little starch and then cooling the liquid to a jelly-like consistency.[14][16]'),
(141, 'Marshmallow', 'thumbnail/b6c9b6c07d01540cc6865c7335522b24a24abc1f.jpeg', 1, '2014-09-05 19:40:47', '2014-09-05 19:40:47', 'b6c9b6c07d01540cc6865c7335522b24a24abc1f.jpeg', 'County: \n\r\n\rIn its modern form, typically consists of sugar and/or corn syrup, water, and gelatin, whipped to a spongy consistency and coated with corn starch. Marshmallow probably came first into being as a medicinal substance, since the mucilaginous extracts comes from the root of the marshmallow plant, Althaea officinalis, which were used as a remedy for sore throats. Concoctions of other parts of the marshmallow plant had medical purposes as well.[17]'),
(142, 'Marzipan', 'thumbnail/5588595ce9873491fb835959b88baead72aed16c.jpeg', 1, '2014-09-05 19:40:47', '2014-09-05 19:40:47', '5588595ce9873491fb835959b88baead72aed16c.jpeg', 'County: \n\r\n\rConsisting primarily of sugar or honey and almond meal, sometimes augmented with almond oil or extract. Pictured is marzipan made into the shapes of fruits.'),
(143, 'Nougat', 'thumbnail/2642ad38bbaf5a9ff8212965319feead4c05d65e.jpeg', 1, '2014-09-05 19:40:48', '2014-09-05 19:40:48', '2642ad38bbaf5a9ff8212965319feead4c05d65e.jpeg', 'County: \n\r\n\rA variety of similar traditional confectioneries made with sugar and/or honey, roasted nuts (almonds, walnuts, pistachios, hazelnuts, and recently macadamia nuts are common), whipped egg whites, and sometimes chopped candied fruit.'),
(144, 'Panforte', 'thumbnail/76554e015aea505edfc6369e6b8a1acfbd4778d0.jpeg', 1, '2014-09-05 19:40:48', '2014-09-05 19:40:48', '76554e015aea505edfc6369e6b8a1acfbd4778d0.jpeg', 'County: \n\r\n\rA traditional Italian dessert containing fruits and nuts, and resembles fruitcake or Lebkuchen. It may date back to 13th century Siena, in Italy''s Tuscany region. Its preparation includes baking a mixture of sugar dissolved in honey, various nuts, fruits and spices and flour. The finished cake is dusted with icing sugar.'),
(145, 'Pudding [6]', 'thumbnail/04930fb9be2d7606767a09fe42dad0c32ed11483.jpeg', 1, '2014-09-05 19:40:49', '2014-09-05 19:40:49', '04930fb9be2d7606767a09fe42dad0c32ed11483.jpeg', 'County: \n\r\n\rMost often refers to a dessert, but can also be a savory dish. Depending on its ingredients such a pudding may be served as a part of the main course or as a dessert.'),
(146, 'Rice Krispie treats', 'thumbnail/868821f0d8c2d50ab52de2f11e4ee9fbf13cc96d.jpeg', 1, '2014-09-05 19:40:49', '2014-09-05 19:40:49', '868821f0d8c2d50ab52de2f11e4ee9fbf13cc96d.jpeg', 'County: United States\n\r\n\rA sweet dessert or snack made from Rice Krispies, melted butter or margarine, and melted marshmallows.[18] Sometimes marshmallows and/or cereal that is seasonal is used to make these treats holiday-specific.'),
(147, 'S''mores', 'thumbnail/a24d0a6ef9f0f7e7d97379eb0800cf3454353f51.jpeg', 1, '2014-09-05 19:40:49', '2014-09-05 19:40:49', 'a24d0a6ef9f0f7e7d97379eb0800cf3454353f51.jpeg', 'County: \n\r\n\rA traditional nighttime campfire treat popular in the United States and Canada consisting of a roasted marshmallow and a layer of chocolate sandwiched between two pieces of graham cracker.[19]'),
(148, 'Toffee', 'thumbnail/42b9d5761bf1a0f4d5b055d46b2499b60b67380d.jpeg', 1, '2014-09-05 19:40:50', '2014-09-05 19:40:50', '42b9d5761bf1a0f4d5b055d46b2499b60b67380d.jpeg', 'County: \n\r\n\rMade by caramelizing sugar or molasses (creating inverted sugar) along with butter, and occasionally flour. Toffee is sometimes prepared with nuts or raisins.'),
(149, 'Turkish delight', 'thumbnail/2af386cb940e67a87d98feaa3469b279184e39b7.jpeg', 1, '2014-09-05 19:40:50', '2014-09-05 19:40:50', '2af386cb940e67a87d98feaa3469b279184e39b7.jpeg', 'County: \n\r\n\rA family of confections based on a gel of starch and sugar. Premium varieties consist largely of chopped dates, pistachios and hazelnuts or walnuts bound by the gel; the cheapest are mostly gel, generally flavored with rosewater, mastic, bergamot orange or lemon.'),
(150, 'Arrowroot', 'thumbnail/1433503af366e0fd8cf355cf1bcc820ced9d0201.jpeg', 1, '2014-09-05 19:40:51', '2014-09-05 19:40:51', '1433503af366e0fd8cf355cf1bcc820ced9d0201.jpeg', 'County: \n\r\n\rArrowroot used to be very popular in British cuisine, and Napoleon supposedly said the reason for the British love of arrowroot was to support the commerce of their colonies.[20] It can be consumed in the form of biscuits, puddings, jellies, cakes, hot sauces, and also with beef tea, milk or veal broth, and noodles in Korean and Vietnamese cuisine.'),
(151, 'Chebakia', 'thumbnail/014751f4463bef1f927a5194d872131515115e0c.jpeg', 1, '2014-09-05 19:40:51', '2014-09-05 19:40:51', '014751f4463bef1f927a5194d872131515115e0c.jpeg', 'County: Morocco [21]\n\r\n\rA sesame cookie that is fried and covered with honey.[21] They''re typically shaped as a flower.[21]'),
(152, 'Chocolate chip cookie', 'thumbnail/1a9f2f45c3841719ae23d0d7415ca71872764d04.jpeg', 1, '2014-09-05 19:40:52', '2014-09-05 19:40:52', '1a9f2f45c3841719ae23d0d7415ca71872764d04.jpeg', 'County: \n\r\n\rA drop cookie that originated in the United States and features chocolate chips as its distinguishing ingredient.'),
(153, 'Cookie [22]', 'thumbnail/3b4a2b3f2061aef0dbe2581b9fcc3576121b8482.jpeg', 1, '2014-09-05 19:40:53', '2014-09-05 19:40:53', '3b4a2b3f2061aef0dbe2581b9fcc3576121b8482.jpeg', 'County: \n\r\n\rIn the United States, Canada and Australia a cookie is a small, flat, baked treat, usually containing fat, flour, eggs and sugar. In Scotland, a cookie is a plain bun.[23] In most English-speaking countries outside North America, including the United Kingdom, the most common word for a small, flat, baked treat, usually containing fat, flour, eggs and sugar is biscuit, however in many regions both terms are used, such as the American-inspired Maryland Cookies, while in others the two words have different meanings. Pictured are butter cookies.'),
(154, 'Ginger Snaps', 'thumbnail/2d82524926a6a6036d6b2afca1ac017bd049f5b5.jpeg', 1, '2014-09-05 19:40:53', '2014-09-05 19:40:53', '2d82524926a6a6036d6b2afca1ac017bd049f5b5.jpeg', 'County: \n\r\n\rA globally popular biscuit based snack food, flavored with ginger.'),
(155, 'Graham crackers', 'thumbnail/e82b05c032bd95df48cfee19ce693f7acf82125a.jpeg', 1, '2014-09-05 19:40:53', '2014-09-05 19:40:53', 'e82b05c032bd95df48cfee19ce693f7acf82125a.jpeg', 'County: Invented in Bound Brook, New Jersey by Sylvester Graham\n\r\n\rThe original graham cracker was made with graham flour, a combination of finely-ground unbleached-wheat flour with the wheat bran and germ coarsely-ground and added back in providing nutrition and flavor.'),
(156, 'Oatmeal cookie', 'thumbnail/468b68eb2377ee4b13df409d50053d5bec71dce7.jpeg', 1, '2014-09-05 19:40:54', '2014-09-05 19:40:54', '468b68eb2377ee4b13df409d50053d5bec71dce7.jpeg', 'County: \n\r\n\rCookies prepared with oatmeal. Raisins and other ingredients such as chocolate chips are also sometimes used.'),
(157, 'Peanut butter cookie', 'thumbnail/0761909fa0921b25238f56131b3c108a9dac745e.jpeg', 1, '2014-09-05 19:40:54', '2014-09-05 19:40:54', '0761909fa0921b25238f56131b3c108a9dac745e.jpeg', 'County: United States\n\r\n\ra type of cookie that is distinguished for having peanut butter as a principal ingredient. The cookie generally originated in the United States, its development dating back to the 1910s.[24]'),
(158, 'Gansito', 'thumbnail/55af33e72a2db5e15382caf2a2eed079a84317e2.jpeg', 1, '2014-09-05 19:40:55', '2014-09-05 19:40:55', '55af33e72a2db5e15382caf2a2eed079a84317e2.jpeg', 'County: Mexico\n\r\n\rA Mexican snack cake, that is filled with both strawberry jelly and a creamy filling. They are covered in chocolate and have a chocolate sprinkle topping. It was created in 1957 by Marinela (the pastries division of the breadmaking Bimbo brand).'),
(159, 'Jaffa Cakes', 'thumbnail/34c11f5ac187adaf8602cf8a2c042fc57bc0e2c5.png', 1, '2014-09-05 19:40:55', '2014-09-05 19:40:55', '34c11f5ac187adaf8602cf8a2c042fc57bc0e2c5.png', 'County: Scotland\n\r\n\rIntroduced by McVitie and Price in 1927 and named after Jaffa oranges, and now manufactured by numerous companies including McVities, Cadbury and other biscuit manufacturers, Tesco and other supermarket chains.'),
(160, 'Snack cake', 'thumbnail/f5e14e1674ac7fb43bb8faa08cf7a998c723a14a.jpeg', 1, '2014-09-05 19:40:55', '2014-09-05 19:40:55', 'f5e14e1674ac7fb43bb8faa08cf7a998c723a14a.jpeg', 'County: \n\r\n\rA baked dessert confectionery made with cake and icing.'),
(161, 'Churros', 'thumbnail/b3d52bb47022d26b3afa17bba76d49f45badd47b.jpeg', 1, '2014-09-05 19:40:56', '2014-09-05 19:40:56', 'b3d52bb47022d26b3afa17bba76d49f45badd47b.jpeg', 'County: \n\r\n\rSometimes referred to as a Spanish doughnut, it''s a fried-dough pastry—predominantly choux—based snack. Churros are popular in Spain, France, the Philippines, Portugal, Latin America (including Brazil and Spanish-speaking Caribbean islands) and the United States. Pictured are churros drizzled with chocolate.'),
