(166, 'Scones', 'thumbnail/1b9128397db9dbb4ec9a755da6545cd51be38f18.jpeg', 1, '2014-09-05 19:40:59', '2014-09-05 19:40:59', '1b9128397db9dbb4ec9a755da6545cd51be38f18.jpeg', 'County: \n\r\n\r'),
(167, 'Amazake', 'thumbnail/c535f4ae5e0a77bb2d0d90fb222bfed115b55a66.jpeg', 1, '2014-09-05 19:41:00', '2014-09-05 19:41:00', 'c535f4ae5e0a77bb2d0d90fb222bfed115b55a66.jpeg', 'County: Japan\n\r\n\rA traditional sweet, low- or non-alcohol (depending on recipes) Japanese drink made from fermented rice. Amazake dates from the Kofun period, and it is mentioned in the Nihon Shoki, the second oldest book of classical Japanese history.'),
(168, 'Coffee', 'thumbnail/d02dcaf0a20e1964d29d58dc42fcfe44e2574485.jpeg', 1, '2014-09-05 19:41:00', '2014-09-05 19:41:00', 'd02dcaf0a20e1964d29d58dc42fcfe44e2574485.jpeg', 'County: Ethiopia; southern Arabia\n\r\n\rA beverage prepared from the dried seeds (known as coffee beans) of Coffea species. It contains caffeine, a mild stimulant.. It is often consumed with sugar and milk mixed in.'),
(169, 'Flavored milk', 'thumbnail/375661cef99e5488c9216de8ccd8381216b8fbdc.jpeg', 1, '2014-09-05 19:41:00', '2014-09-05 19:41:00', '375661cef99e5488c9216de8ccd8381216b8fbdc.jpeg', 'County: \n\r\n\r'),
