(178, 'Sports drinks (Gatorade, Powerade)', 'thumbnail/b6382536cec581e570134f220da24afed7aaf76a.jpeg', 1, '2014-09-05 19:41:04', '2014-09-05 19:41:04', 'b6382536cec581e570134f220da24afed7aaf76a.jpeg', 'County: \n\r\n\r'),
(179, 'Tea', 'thumbnail/8c408ee2572a3715f5cd67d1795152ef6f244dc9.jpeg', 1, '2014-09-05 19:41:05', '2014-09-05 19:41:05', '8c408ee2572a3715f5cd67d1795152ef6f244dc9.jpeg', 'County: \n\r\n\rA drink usually drank warm. It contains hot water, a teabag for flavour, and sometimes milk and sugar is added.'),
(180, 'Tejuino', 'thumbnail/d80642dde86225fede7396f890f813638be908e0.jpeg', 1, '2014-09-05 19:41:05', '2014-09-05 19:41:05', 'd80642dde86225fede7396f890f813638be908e0.jpeg', 'County: Jalisco, Mexico\n\r\n\rA cold beverage made from fermented corn. It is often served with a scoop of shaved ice.'),
(181, 'Frozen custard', 'thumbnail/25dca6a26bca4022137119af41438a1f9225169f.jpeg', 1, '2014-09-05 19:41:05', '2014-09-05 19:41:05', '25dca6a26bca4022137119af41438a1f9225169f.jpeg', 'County: Coney Island, New York\n\r\n\rA cold dessert similar to ice cream, but made with eggs in addition to cream and sugar. It was invented in Coney Island, New York in 1919, when ice cream vendors Archie and Elton Kohr found that adding egg yolks to ice cream created a smoother texture and helped the ice cream stay cold longer. In their first weekend on the boardwalk, the Kohr brothers sold 18,460 cones.[26]'),
(182, 'Ice cream [22]', 'thumbnail/f866ec6b3f812458ec884720d50658382d4b09a6.jpeg', 1, '2014-09-05 19:41:06', '2014-09-05 19:41:06', 'f866ec6b3f812458ec884720d50658382d4b09a6.jpeg', 'County: \n\r\n\rA frozen dessert usually made from dairy products, such as milk and cream, and often combined with fruits or other ingredients and flavours. Most varieties contain sugar, although some are made with other sweeteners. The meaning of the phrase "ice cream" varies from one country to another. Phrases such as "frozen custard", "frozen yogurt", "sorbet", "gelato" and others are used to distinguish different varieties and styles. In some countries, such as the United States, the phrase "ice cream" applies only to a specific variety, and most governments regulate the commercial use of the various terms according to the relative quantities of the main ingredients.[27] In other countries, such as Italy and Argentina, one word is used for all variants.'),
(183, 'Ice pop', 'thumbnail/b5b670f22f66f99eebe5a3737d39116e23d0bd8c.jpeg', 1, '2014-09-05 19:41:06', '2014-09-05 19:41:06', 'b5b670f22f66f99eebe5a3737d39116e23d0bd8c.jpeg', 'County: San Francisco\n\r\n\rA water-based frozen snack that is made by freezing flavored liquid (such as fruit juice) around a stick. The first recorded ice pop was created in 1905 by 11-year-old Frank Epperson of San Francisco, who left a glass of soda water powder and water outside in his back porch with a wooden mixing stick in it. In the United States and Canada frozen ice on a stick is generically referred to as a popsicle due to the early popularity of the Popsicle brand. In Ireland the product is also referred to as a freeze pop. In the United Kingdom the term ice lolly is used. Ice block is used in parts of Australia[28][29] and New Zealand, as well as icy pole, after a brand of the same name.[30]'),
(184, 'Milkshake', 'thumbnail/2ebf923fcba0b60afbc4d3e1af55ff32ddc0e215.jpeg', 1, '2014-09-05 19:41:07', '2014-09-05 19:41:07', '2ebf923fcba0b60afbc4d3e1af55ff32ddc0e215.jpeg', 'County: \n\r\n\rA sweet, cold beverage which is usually made from milk, ice cream or iced milk, and flavorings or sweeteners such as fruit syrup or chocolate sauce. Outside the United States, the drink is sometimes called a "thickshake" or a "thick milkshake" or in New England, a "frappe". When the term "milkshake" was first used in print in 1885, milkshakes were an alcoholic whiskey drink that has been described as a "sturdy, healthful eggnog type of drink, with eggs, whiskey, etc., served as a tonic as well as a treat".[31] However, by 1900, the term referred to "wholesome drinks made with chocolate, strawberry, or vanilla syrups." By the "early 1900s people were asking for the new treat, often with ice cream."[31]'),
(185, 'Ada', 'thumbnail/4e70070a571a703cc0c9421451b9441fbedb6a09.jpeg', 1, '2014-09-05 19:41:09', '2014-09-05 19:41:09', '4e70070a571a703cc0c9421451b9441fbedb6a09.jpeg', 'County: Kerala\n\r\n\rA traditional[35] Keralan delicacy, consisting of rice parcels encased in a dough made of rice flour, with sweet fillings, steamed in banana leaf and served as an evening snack or as part of breakfast. Grated coconut and rice flour are the two main ingredients.'),
(186, 'Dolma', 'thumbnail/c45aa56974d28cb9c775a92431e447ab7f701890.jpeg', 1, '2014-09-05 19:41:09', '2014-09-05 19:41:09', 'c45aa56974d28cb9c775a92431e447ab7f701890.jpeg', 'County: Balkans, Middle East, Caucases\n\r\n\r'),
