(189, 'Khandvi [36]', 'thumbnail/8ebc0cb3765cf55e9bcf87be35040e9ceabf82c5.jpeg', 1, '2014-09-05 19:41:10', '2014-09-05 19:41:10', '8ebc0cb3765cf55e9bcf87be35040e9ceabf82c5.jpeg', 'County: Gujarat\n\r\n\rA collective term used for a type of snacks in Gujarati cuisine, from the Indian state of Gujarat.'),
