(199, 'Energy bar [10]', 'thumbnail/1ead2cc7aeb126448a24a3d3618a077575c2a088.jpeg', 1, '2014-09-05 19:41:15', '2014-09-05 19:41:15', '1ead2cc7aeb126448a24a3d3618a077575c2a088.jpeg', 'County: \n\r\n\rFood bars containing cereals and other high energy foods. The first energy bar in the American marketplace was Space Food Sticks which Pillsbury Company created in the late 1960s to capitalize on the popularity of the U.S. space program.'),
(200, 'Flapjack', 'thumbnail/72e7401ac33357c8359cd25578e6befd316f2545.jpeg', 1, '2014-09-05 19:41:15', '2014-09-05 19:41:15', '72e7401ac33357c8359cd25578e6befd316f2545.jpeg', 'County: \n\r\n\rA sweet tray-baked oat bar made from rolled oats, butter, brown sugar and golden syrup. The item is known as a "flapjack" in the United Kingdom and Ireland and as a "cereal bar" in Australia and New Zealand. In other countries such products are referred to as granola bars.'),
(201, 'Granola bar [37]', 'thumbnail/55f3c885b91539a58d093d19d4bbf7c9b3cc5a9c.jpeg', 1, '2014-09-05 19:41:15', '2014-09-05 19:41:15', '55f3c885b91539a58d093d19d4bbf7c9b3cc5a9c.jpeg', 'County: \n\r\n\rGranola bars were invented by Stanley Mason[38][39] and have become popular as a snack, similar to the traditional flapjack oat bar or muesli bar familiar in the Commonwealth countries.'),
(202, 'Bagel [6]', 'thumbnail/31a16e6b021a7cb00b512fe86af30db0b6e950f4.jpeg', 1, '2014-09-05 19:41:16', '2014-09-05 19:41:16', '31a16e6b021a7cb00b512fe86af30db0b6e950f4.jpeg', 'County: \n\r\n\rA bread product, traditionally shaped by hand into the form of a ring from yeasted wheat dough, roughly hand-sized, which is first boiled for a short time in water and then baked.[40]'),
