(215, 'American cheese', 'thumbnail/d37c53c8e7926373c4dc1b0313707ab5a0b13332.jpeg', 1, '2014-09-05 19:41:23', '2014-09-05 19:41:23', 'd37c53c8e7926373c4dc1b0313707ab5a0b13332.jpeg', 'County: United States\n\r\n\rA processed cheese from the U.S. American cheese was originally only white, but is now sometimes modified to be yellow-colored. Today it is typically manufactured from a set of ingredients[43] such as milk, whey, milkfat, milk protein concentrate, whey protein concentrate, and salt.'),
(216, 'Cheese [10]', 'thumbnail/6ad091a9360d1099ed55fea3a806bfe9500f8ee1.jpeg', 1, '2014-09-05 19:41:23', '2014-09-05 19:41:23', '6ad091a9360d1099ed55fea3a806bfe9500f8ee1.jpeg', 'County: \n\r\n\rA generic term for a diverse group of milk-based food products. Pictured is a plate of assorted cheeses.'),
