(218, 'Banana chip', 'thumbnail/2ba06080d1b3426af4bfdd3c7dd250cf3b67060a.jpeg', 1, '2014-09-05 19:41:24', '2014-09-05 19:41:24', '2ba06080d1b3426af4bfdd3c7dd250cf3b67060a.jpeg', 'County: \n\r\n\rDeep-fried and/or dried slices of bananas. They can be covered with sugar or honey and have a sweet taste, or they can be fried in oil and spices and have a salty and/or spicy taste.[44]'),
