(230, 'Animal cracker', 'thumbnail/f19aadf4f822e860267bd80070fb5d733aaef6d9.jpeg', 1, '2014-09-05 19:41:30', '2014-09-05 19:41:30', 'f19aadf4f822e860267bd80070fb5d733aaef6d9.jpeg', 'County: \n\r\n\rA small cracker or cookie baked in the shape of an animal, usually an animal one might see at a zoo. The most common variety is light-colored and slightly sweet, but darker chocolate-flavored and colorful frosted varieties are also manufactured.'),
(231, 'Arare', 'thumbnail/ec455efee6d985c3554ef1d4a3473238a5adcfa2.jpeg', 1, '2014-09-05 19:41:30', '2014-09-05 19:41:30', 'ec455efee6d985c3554ef1d4a3473238a5adcfa2.jpeg', 'County: \n\r\n\rArare are small Japanese rice crackers.'),
