(233, 'Bacon', 'thumbnail/c2cc2f82567e2649440598f3da68ad6936eea813.png', 1, '2014-09-05 19:41:32', '2014-09-05 19:41:32', 'c2cc2f82567e2649440598f3da68ad6936eea813.png', 'County: \n\r\n\rA cured meat prepared from a pig, bacon is prepared from several different cuts of meat.'),
(234, 'Bombay mix', 'thumbnail/7739cd23354a644198c91bb9e138319be302cf11.jpeg', 1, '2014-09-05 19:41:32', '2014-09-05 19:41:32', '7739cd23354a644198c91bb9e138319be302cf11.jpeg', 'County: \n\r\n\rBombay mix is the name used in the United Kingdom and Ireland for a traditional Indian snack known as chiwda, chevdo, bhuso (if made without potato), chevda or chivdo in India, or Chanāchura in Odisha and chanachur in Bengal. It consists of a variable mixture of spicy dried ingredients, which may include fried lentils,[56]peanuts, chickpea flour noodles, corn, vegetable oil, chickpeas, flaked rice, fried onion and curry leaves.'),
(235, 'Cup Noodles', 'thumbnail/abd419d2a833de4285418d308d3d2b9ed6540a69.jpeg', 1, '2014-09-05 19:41:32', '2014-09-05 19:41:32', 'abd419d2a833de4285418d308d3d2b9ed6540a69.jpeg', 'County: \n\r\n\rA well-known brand of instant ramen noodle snack manufactured by Nissin, packaged in a foam food container, hard plastic or paper cup. Other brand names are used in specific countries, such as Cup Noodle in Japan.'),
(236, 'Instant noodles [22]', 'thumbnail/fa7d4caa21505fbf69fec57ba955f07810b445c7.jpeg', 1, '2014-09-05 19:41:33', '2014-09-05 19:41:33', 'fa7d4caa21505fbf69fec57ba955f07810b445c7.jpeg', 'County: Invented by Momofuku Ando of Nissin Foods, Japan.[57]\n\r\n\rdried or precooked noodles and are often sold with packets of flavoring including seasoning oil. Dried noodles are usually eaten after being cooked or soaked in boiling water, while precooked noodles can be reheated or eaten straight from the packet.'),
(237, 'Ramen', 'thumbnail/2c98c3e04a0fe07549fede7a8272ffafecc9bc76.jpeg', 1, '2014-09-05 19:41:33', '2014-09-05 19:41:33', '2c98c3e04a0fe07549fede7a8272ffafecc9bc76.jpeg', 'County: \n\r\n\rA Japanese noodle dish that consists of Chinese-style wheat noodles served in a meat- or (occasionally) fish-based broth, often flavored with soy sauce or miso, and uses toppings such as sliced pork, chāshū, dried seaweed, nori, kamaboko, green onions, and occasionally corn.');
